import React, { useEffect, useState } from 'react'

function App() {

  const [games, setGames] = useState([{}])

  useEffect(() => {
    fetch("/api/games")
      .then(response => response.json())
      .then(data => {setGames(data)})
    }, [])

  return (
    <>
      <pre>
        <h2>Games</h2>
        {JSON.stringify(games[0], null, 2)}
      </pre>

      <h1>Games</h1>

    </>
  )
}

export default App
